import "./Blog.css";
import Poster from "./Poster";

const Blog = () => {
  return (
    <section className="blog">
      <div className="scroll_blog">
        <h1>BLOG</h1>
        <hr />
        <div className="container_blog">
          <div className="box_blog1">
            <img
              src="https://www.pexels.com/id-id/foto/monitor-komputer-layar-datar-hitam-1714208/"
              alt=""
            />
          </div>
          <div className="box_blog1">box 2</div>
          <div className="box_blog1">box 3</div>
          <div className="box_blog1">box 4</div>
          <div className="box_blog1">box 5</div>
        </div>
      </div>
    </section>
  );
};

export default Blog;
